Storyline:


     The 1906 Australian film 'The Story of the Kelly Gang' is believed to be the world's first feature length film and was one hour in length. Only fragments are known to survive: 296m or 971 feet which totals almost fifteen minutes of screen time when projected at 18 frames per second. This film is a study which tells that story using the remaining fragments of the original film.





